const App = () => {
  const queryClient = new QueryClient();

  return (
    <QueryClientProvider client={queryClient}>
      <Switch>
        <Route path="/">
          <MainPage />
          <About />
        </Route>
        <Route path="/revisited">
          <span>sike</span>
        </Route>
      </Switch>
    </QueryClientProvider>
  );
};

export default App;
